private void addCreated(final E element, final int i) {
  if (i >= 0) {
    throw new AssertionError("Element already exists: element=" + element
        + ", created=" + created);
  }
  if (created == null) {
    created = new ArrayList<>(DEFAULT_ARRAY_INITIAL_CAPACITY);
  }
  created.add(-i - 1, element);
}
